  const x = localStorage.getItem("totalbill");
  const totalBill = parseFloat(x);
  const itemsbought = localStorage.getItem("itemsbought");
  const look = parseFloat(itemsbought);

  return (
    <div className="container">
      <h1>Your total is ${totalBill}</h1>
      <p>The items your bought are ${look} </p>
    </div>
  );
}
